pub enum ChannelMsg<Msg: Message> {
    Publish(Publish<Msg>),
    Subscribe(Subscribe<Msg>),
    Unsubscribe(Unsubscribe<Msg>),
    UnsubscribeAll(UnsubscribeAll<Msg>),
}

pub enum CreateError {
    Panicked,
    System,
    InvalidName(String),
    AlreadyExists(ActorPath),
}

pub enum KernelMsg {
    TerminateActor,
    RestartActor,
    RunActor,
    Sys(ActorSystem),
}

pub enum SystemMsg {
    ActorInit,
    Command(SystemCmd),
    Event(SystemEvent),
    Failed(BasicActorRef),
}

pub enum SystemEvent {
    ActorCreated(ActorCreated),
    ActorRestarted(ActorRestarted),
    ActorTerminated(ActorTerminated),
}
